	/**
	 * computes this.detectEqualities().coalesce().removeRedundancies() and
	 * then tries, in order to reduce the number of basic sets : 
	 * this.copy().simpleHull().toSet().subtract(this.copy().complement());
	 */
	public JNIISLSet simplify() {
		JNIISLSet s = this.detectEqualities().coalesce().removeRedundancies();
		JNIISLSet simplify = s.copy().simpleHull().toSet()
				.subtract(s.copy().complement());
		if (simplify.getNbBasicSets() < s.getNbBasicSets())
			s = simplify;
		s = s.detectEqualities().coalesce().removeRedundancies();
		return s;
	}

	
	public JNIISLSet pad(int dim, int size) {
		JNIISLSet res = this.copy();

		JNIISLBasicMap shift = JNIISLBasicMap.buildUniverse(JNIISLSpace
				.idMapDimFromSetDim(res.getSpace().copy()));
		long n = res.getSpace().getNbDims(JNIISLDimType.isl_dim_set);
		for (int i = 0; i < n; i++) {
			if (i != dim) {
				JNIISLConstraint c = JNIISLConstraint.buildEquality(JNIISLLocalSpace
						.fromSpace(shift.getSpace().copy()));
				c = c.setCoefficient(JNIISLDimType.isl_dim_in, i, 1);
				c = c.setCoefficient(JNIISLDimType.isl_dim_out, i, -1);
				shift = shift.addConstraint(c);
			} else {
				JNIISLConstraint c1 = JNIISLConstraint
						.buildInequality(JNIISLLocalSpace.fromSpace(shift.getSpace()
								.copy()));
				c1 = c1.setCoefficient(JNIISLDimType.isl_dim_in, i, -1);
				c1 = c1.setCoefficient(JNIISLDimType.isl_dim_out, i, 1);

				JNIISLConstraint c2 = JNIISLConstraint
						.buildInequality(JNIISLLocalSpace.fromSpace(shift.getSpace()
								.copy()));
				c2 = c2.setCoefficient(JNIISLDimType.isl_dim_in, i, 1);
				c2 = c2.setCoefficient(JNIISLDimType.isl_dim_out, i, -1);
				c2 = c2.setConstant(size);

				shift = shift.addConstraint(c1);
				shift = shift.addConstraint(c2);
			}
		}
		JNIISLMap shiftMap = shift.toMap();
		res = res.apply(shiftMap);
		return res.coalesce();
	}

