	public JNIISLSet convertTo(JNIISLSpace target) {
		JNIISLSpace space = this.getSpace();
		if (target.getNbDims(JNIISLDimType.isl_dim_param) != space
				.getNbDims(JNIISLDimType.isl_dim_param)) {
			throw new UnsupportedOperationException(
					"Parameter mismatch : cannnot convert " + space + " to "
							+ target);
		} else {
			String mapStr = "" + this.getParametersNames() + "-> { "
					+ getIndicesNames() + " ->  "
					+ target.getNameList(JNIISLDimType.isl_dim_set) + "  :";
			List<String> nameList = space
					.getNameList(JNIISLDimType.isl_dim_set);
			List<String> assgnList = new ArrayList<String>();
			List<String> targetNames = target
					.getNameList(JNIISLDimType.isl_dim_set);
			int insize = nameList.size();
			for (int i = 0; i < insize; i++) {
				assgnList.add(targetNames.get(i) + "=" + nameList.get(i));
			}
			mapStr += asList(assgnList, " & ") + " }";
			JNIISLMap islMap = ISLFactory.islMap(mapStr);
			return this.copy().apply(islMap);
		}
	}

