	public JNIISLMap lexFirstMap(int nbLoops) {
		int n = (int) this.getNDim() - nbLoops;
		JNIISLMap m = JNIISLMap.fromDomainAndRange(
				JNIISLSet.buildUniverseLike(this.copy()), this.copy());
		JNIISLBasicMap bm = JNIISLBasicMap.buildUniverse(m.getSpace());
		for (int i = 0; i < n; i++) {
			JNIISLConstraint c = JNIISLConstraint.buildEquality(JNIISLLocalSpace
					.fromSpace(m.getSpace()));
			c = c.setCoefficient(JNIISLDimType.isl_dim_in, i, 1);
			c = c.setCoefficient(JNIISLDimType.isl_dim_out, i, -1);
			bm = bm.addConstraint(c);
		}
		JNIISLMap ma = bm.toMap();
		m = m.intersect(ma).lexMin();
		//m = m.projectOut(JNIISLDimType.isl_dim_out, 0, n);
		return m;
	}


	/**
	 * keeps only one given dimension (pos) of the given dimension type
	 * 
	 * @param type
	 * @param pos
	 * @return
	 */
	public JNIISLSet projectIn(JNIISLDimType type, int pos) {
		int nbdims = (int) this.getSpace().getNbDims(type);
		if (pos < 0 || pos >= nbdims)
			throw new IllegalArgumentException();
		JNIISLSet res = this;
		if (pos + 1 <= nbdims - 1)
			res = res.projectOut(type, pos + 1, nbdims - pos - 1);
		if (pos - 1 >= 0)
			res = res.projectOut(type, 0, pos);
		
		return res;
	}
